import React, { Component } from 'react';

import ImgReme      from '../../img/reme1.jpg';
import NumberFormat from 'react-number-format';

import { Link } from 'react-router-dom';

import { ContextoUsuario } from '../Session';

export default class PaginacaoCarrinho extends Component {

    /*
        produtos
        total de produtos
    */

    render() {

        const { produtos } = this.props;

        return (
            <div className="main-container-carrinho">
                <div className="grid-main">
                    {produtos.length > 0? (
                        <ul>
                            {produtos.map(produto =>{
                                return (
                                    <li key={produto.id}>
                                        <div className="div-card-carrinho">
                                            <h5 className="h-titulo">Produto</h5>
                                            <h5 className="h-titulo">Descricao</h5>
                                            <h5 className="h-titulo">Quantidade</h5>
                                            <h5 className="h-titulo">Data</h5>
                                            <h5 className="h-titulo">Preço</h5>
                                            <div className="div-img-carrinho">
                                            <img id="img-reme-peq" src={ImgReme}/> 
                                            </div>
                                            <div className="div-descricao-carrinho">
                                                <p>{produto.descricao}</p>
                                            </div>
                                            <div className="div-qtd-carrinho">
                                                    {produto.quantidade > 0? (
                                                        <select>
                                                            <option value="1" label="1">1</option>
                                                            <option value="3" label="3">3</option>
                                                            <option value="5" label="5">5</option>
                                                        </select>
                                                    ) : (
                                                        <select>
                                                            <option value="0" label="0">0</option>
                                                        </select>
                                                    )}
                                                    <button onClick={e => this.removeLocalStorege(produto.id)}>remover</button>
                                            </div>
                                            <div className="div-entrega-carrinho">
                                                <span>10/10/2019</span>
                                            </div>
                                            <div className="div-preco-carrinho">
                                               <NumberFormat 
                                                    value={produto.preco} 
                                                    displayType={'text'}
                                                    prefix={'R$'}
                                                    decimalSeparator={','}
                                                    decimalScale={2}
                                                    fixedDecimalScale={true}
                                                />
                                            </div>
                                        </div>
                                    </li>
                                );
                            })}    
                        </ul>
                    ): (
                        <div className="vazia">
                            Não há itens no carrinho :(
                        </div>
                    )}

                    {produtos.length > 0 ? (
                        <div className="div-resumo">
                            <strong>Resumo Pedido</strong>
                            <div className="itens-resumo">
                                <span>Subtotal({produtos.length} produto(os))</span>
                                <span>
                                    <NumberFormat 
                                        value={10} 
                                        displayType={'text'}
                                        prefix={'R$'}
                                        decimalSeparator={','}
                                        decimalScale={2}
                                        fixedDecimalScale={true}
                                    />
                                </span>
                            </div>
                            <div className="itens-resumo">
                                <span>Frete</span>
                                <span>
                                    <NumberFormat 
                                        value={10} 
                                        displayType={'text'}
                                        prefix={'R$'}
                                        decimalSeparator={','}
                                        decimalScale={2}
                                        fixedDecimalScale={true}
                                    />
                                </span>
                            </div>
                            <hr/>
                            <div className="itens-resumo-total">
                                <span>Total</span>
                                <span>
                                    <NumberFormat 
                                        value={10} 
                                        displayType={'text'}
                                        prefix={'R$'}
                                        decimalSeparator={','}
                                        decimalScale={2}
                                        fixedDecimalScale={true}
                                    />
                                </span>
                            </div>
                            <hr/>
                            <Link to={"/Compra/Endereco"}>
                                <span><button className="btn azul-roxo clicavel" type="button">Comprar</button></span>
                            </Link>
                        </div>
                    ) : ""}
                </div>
            </div>
        );
    }

}
